import React, { useState, useEffect } from 'react';

import PatientNavBar from '../Components/PatientNavBar'
function Hospitals() {
    const [hospital, setHospital] = useState([
        {
            hospitalId: 1,
            hospitalName: "Krishna",
            hospitalAddress: "KUniamuthur"
        },
        {
            hospitalId: 2,
            hospitalName: "Kumaraguru",
            hospitalAddress: "Saravanampatti"
        },
        {
            hospitalId: 3,
            hospitalName: "KMCH",
            hospitalAddress: "Neelambur"
        },
        {
            hospitalId: 3,
            hospitalName: "KMCH",
            hospitalAddress: "Neelambur"
        },
    ])
    return (
        <>
            <PatientNavBar />
            <div>
                {
                    hospital.map((hos)=>
                        <div className="box">
                            <h2>{hos.hospitalName}</h2>
                            <h2>{hos.hospitalId}</h2>
                            <h2>{hos.hospitalAddress}</h2>
                        </div>
                    )
                }
            </div>
        </>
    )
}

export default Hospitals
